import { createRouter, createWebHistory } from 'vue-router';
import WardrobeView from '../views/WardrobeView.vue';
import WeatherView from '../views/WeatherView.vue';
import InspirationView from '../views/InspirationView.vue';
import AnalysisView from '../views/AnalysisView.vue';
import UploadView from '../views/UploadView.vue';
import CustomView from '../views/CustomView.vue';
import StatsView from '../views/StatsView.vue';

const routes = [
  {
    path: '/',
    name: 'wardrobe',
    component: WardrobeView,
    meta: {
      title: '我的衣橱 - StyleVault',
      description: '管理您的衣物收藏和搭配方案',
    },
  },
  {
    path: '/weather',
    name: 'weather',
    component: WeatherView,
    meta: {
      title: '天气穿搭 - StyleVault',
      description: '根据天气条件获取穿搭建议',
    },
  },
  {
    path: '/inspiration',
    name: 'inspiration',
    component: InspirationView,
    meta: {
      title: '搭配灵感 - StyleVault',
      description: '发现和保存穿搭灵感',
    },
  },
  {
    path: '/custom',
    name: 'custom',
    component: CustomView,
    meta: {
      title: '自定义搭配 - StyleVault',
      description: '创建和管理自定义搭配方案',
    },
  },
  {
    path: '/analysis',
    name: 'analysis',
    component: AnalysisView,
    meta: {
      title: '穿搭分析 - StyleVault',
      description: '分析您的穿搭习惯和偏好',
    },
  },
  {
    path: '/stats',
    name: 'stats',
    component: StatsView,
    meta: {
      title: '数据统计 - StyleVault',
      description: '查看衣橱使用统计和分析数据',
    },
  },
  {
    path: '/upload',
    name: 'upload',
    component: UploadView,
    meta: {
      title: '上传衣物 - StyleVault',
      description: '上传和管理新的衣物',
    },
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

// 路由守卫：设置页面标题
router.beforeEach((to, from, next) => {
  if (to.meta && to.meta.title) {
    document.title = to.meta.title;
  } else {
    document.title = 'StyleVault - 智能穿搭管理';
  }
  next();
});

export default router;
